import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className='header'>
          <h3 className='sign'>掲示板</h3>
          <h3 className='make'>スレッドを作成</h3>
        </div>
      </header>
    </div>
  );
}

export default App;
